import User from './user/User';
import c from './Users.module.css';

const Users = (props) => {

    let allUsersData = props.allUsers.map(au => <User name={au.name} />)

    return(
        <div className={c.Users}>
            <User />
            <button>Подписка</button><hr />
        </div>
    )
}

export default Users;
